import React from 'react'
import "./navBar.css";

function navBar() {
    return (
        <div className="navBar">
           <img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png" alt="Netflix" /> 
           h1
           
           <img className="avatar" src="https://i.pinimg.com/originals/0d/dc/ca/0ddccae723d85a703b798a5e682c23c1.png'%C2%A7" alt="" />
        </div>
    )
}

export default navBar
